import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import Measurements from './Measurements';
import PersonalRecords from './PersonalRecords';
import WorkoutRoutine from './WorkoutRoutine';
import AIChat from './AIChat';
import AppointmentForm from './AppointmentForm';

const ClientDashboard = () => {
  return (
    <div>
      <nav>
        <ul style={{ display: 'flex', justifyContent: 'space-around', listStyle: 'none', padding: '20px 0' }}>
          <li><Link to="/dashboard/measurements">Measurements</Link></li>
          <li><Link to="/dashboard/personal-records">Personal Records</Link></li>
          <li><Link to="/dashboard/workout-routine">Workout Routine</Link></li>
          <li><Link to="/dashboard/ai-chat">AI Chat</Link></li>
          <li><Link to="/dashboard/appointment">Make Appointment</Link></li>
        </ul>
      </nav>

      <Switch>
        <Route path="/dashboard/measurements" component={Measurements} />
        <Route path="/dashboard/personal-records" component={PersonalRecords} />
        <Route path="/dashboard/workout-routine" component={WorkoutRoutine} />
        <Route path="/dashboard/ai-chat" component={AIChat} />
        <Route path="/dashboard/appointment" component={AppointmentForm} />
      </Switch>
    </div>
  );
};

export default ClientDashboard;
